import React from "react";
import "./LandingPage.css";

function LandingPage() {
  return (
    <section className="landing-page-container">
      <div className="textbloc">
        <div className="christmas-raffle">Christmas Collectible Raffle</div>
        {/* <div className="mint-test">Mint is LIVE</div> */}
        <div className="select-mint">

        <label htmlFor="ordinateurs">Choisir ordinateur</label>
        <select name="ordinateurs" id="ordinateurs">
          <option value="macbook">Macbook</option>
          <option value="thinkpad">ThinkPad</option>
          <option value="dell">Dell</option>
        </select>
        </div>
      </div>
    </section>
  );
}

export default LandingPage;
